 @Oscum  it was just a dab, not a compilation video of all her old videos. she even chortles at one point, under her breath. god, stop being so bloody serious. people who constantly mention her past life are really annoying, but people like you who act like she's a fucking PTSD-stricken holocaust survivor because she used to make shitposts aren't much better.

she's an adult. she might not have been happy in her past life, but we don't know that. we don't know her, for that matter. she only really implied that once, and it was so vague it could be nothing to do with that channel. she's an adult woman, she doesn't need to be coddled like that. 

she knows who she was, and she knows we know, too. even if a dab did make her think of her past, somehow, it's hardly going to make her act like that out of sadness, fear, or whatever. unless she was making those videos at gunpoint in somebody's basement for years, she isn't going to have flashbacks or whatever if she sees something that reminds her of it. that's not how people work.
